import {
  Button,
  FormControl,
  FormControlLabel,
  InputLabel,
  MenuItem,
  Radio,
  RadioGroup,
  Select,
  styled,
  TextField,
} from "@mui/material";

import { useCallback, useEffect, useState } from "react";
import { Controller, FormProvider, useForm } from "react-hook-form";
import { getFieldState } from "../utils/getFieldState";
import validator from "validator";
import { validateIIN } from "../utils/validateNumbers";
import { Bank } from "../components/Bank";
import { Address } from "../components/Address";
import InputMask from "react-input-mask";
import { values } from "mobx";
import { PersonalInfo } from "../components/PersonalInfo";
export const FormPage = () => {
  // const label = { inputProps: { "aria-label": "Checkbox demo" } };

  const methods = useForm({
    mode: "onChange",
    defaultValues: {
      status: "",
      iin: "",
      fullNameOfOrganization: "",
      secondName: "",
      firstName: "",
      fathersName: "",
      email: "",
      phone: "",
      position: "",
      responsobilities: "",
      region: null,
      area: "",
      adress: "",
      bank: "",
      bik: "",
      iik: "",
      kbe: "",
    },
  });
  const { handleSubmit, control, reset, getValues, formState } = methods;

  const onSubmit = useCallback(
    (values: any) => {
      alert("SUBMIT");
      console.log(values);

      reset();
    },
    [reset],
  );
  const show = () => {
    alert(methods);
  };

  return (
    <FormProvider {...methods}>
      <form onSubmit={handleSubmit(onSubmit)} style={{ marginLeft: "60px" }}>
        <h3>Данные об организации</h3>

        <FormControl fullWidth sx={{ mb: 2 }}>
          <Controller
            name="status"
            control={control}
            rules={{
              required: "Поле обязательное",
            }}
            render={({ field, fieldState, formState }) => (
              <tr>
                <td> БИН /ИИН:</td>
                <td>
                  <RadioGroup
                    {...field}
                    {...getFieldState({ fieldState, formState })}
                    aria-labelledby="demo-radio-buttons-group-label"
                    defaultValue="female"
                    name="radio-buttons-group">
                    <FormControlLabel value="АО" control={<Radio />} label="АО" />
                    <FormControlLabel value="ТОО" control={<Radio />} label="ТОО" />
                    <FormControlLabel value="ИП" control={<Radio />} label="ИП" />
                  </RadioGroup>
                </td>
              </tr>
            )}
          />
        </FormControl>

        <FormControl fullWidth sx={{ mb: 2 }}>
          <Controller
            name="iin"
            control={control}
            rules={{
              required: "Поле обязательное",
              validate: (value) => {
                if (validateIIN(value)) {
                  return true;
                } else {
                  return "Not Valid";
                }
              },
            }}
            render={({ field, fieldState, formState }) => (
              <tr>
                <td> БИН /ИИН:</td>
                <td>
                  <InputMask
                    mask="99-99-99-99-99-99"
                    id="outlined-basic"
                    {...getFieldState({ fieldState, formState })}
                    {...field}
                  />
                </td>
              </tr>
            )}
          />
        </FormControl>

        <FormControl fullWidth sx={{ mb: 2 }}>
          <Controller
            name="fullNameOfOrganization"
            control={control}
            rules={{
              required: "Поле обязательное",
              validate: (value) => {
                if (value.length < 200) {
                  return true;
                } else {
                  return "Not Valid";
                }
              },
            }}
            render={({ field, fieldState, formState }) => (
              <tr>
                <td> Полное наименование:</td>
                <td>
                  <TextField
                    id="outlined-basic"
                    label="Name"
                    {...getFieldState({ fieldState, formState })}
                    variant="outlined"
                    {...field}
                  />
                </td>
              </tr>
            )}
          />
        </FormControl>
        <PersonalInfo />

        <Address />
        <Bank />
        <Button type="submit" variant="contained">
          Подписать с ЭЦП
        </Button>
        <Button variant="contained" onClick={show}>
          show
        </Button>
      </form>
    </FormProvider>
  );
};
